  true,\n\t\"url\": null,\n\t\"notes\": \"The Ship Manager Performance Evaluation
  and Appraisal database is designed to achieve standardization in the evaluation,
  appraisal and documentation of performance thereby providing Ship Manager Management
  with consistent and timely information.   It is the primary tool supporting the
  award term incentive (follow-on contract years) program under the performance based
  Ship Manager Contract.  The incentives are a function of the Ship Manager (contractor)
  maintaining levels of performance of Satisfactory or above for the preceding years
  of the contract.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
